import React from 'react';
import Comment from './components/Comment';
import { faker } from "@faker-js/faker";
import './App.css';

function App(props) {

  console.log(props)

  return (
    <div className="ui container comments">
      <Comment author='sam'
              timeAgo='today at 5:00 pm'
              content='I like the post'
              avatar={faker.image.avatar()}/>
      <Comment author='Alex'
              timeAgo='tomorrow at 5:00 pm'
              content='Nice post'
              avatar={faker.image.avatar()}/> 
      <Comment author='Jack'
       timeAgo='yesterday at 5:00 pm' content='Good idea' avatar={faker.image.avatar()}/>       
    </div>
  );   
}



export default App;
